function loadStaff(a,t){for(var f=$("<tbody></tbody>"),n=0;n<a.length;n++){var e=a[n];f.append('<tr><td><img src="https://crafatar.com/renders/body/'+e.uuid+'?helm&scale=5"></td><td><h2>'+e.name+"</h2><p>Chat name: "+aCodesToHTML(t[e.rank]+("off"===e.nick?e.name:e.nick))+"<br>"+e.desc+"</p></td></tr>")}$("#staff-table").append(f)}$.getJSON("json/staff/staff.json",function(a){$.getJSON("json/staff/prefixes.json",function(t){loadStaff(JSON.parse(a),JSON.parse(t))})});
